<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>iframe</title>
    <link rel="shortcut icon" href="assets/images/Logo.png" type="image/x-icon">
</head>
<body>
    <iframe width="250" height="250" src="https://getbootstrap.com/docs/5.0/getting-started/introduction/" frameborder="0"></iframe>
    <iframe
        src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3956.816486716969!2d109.23795677413122!3d-7.374454772577945!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e655f749626eca1%3A0xc29b3b3d8d8326aa!2sThe%20Village%20Purwokerto!5e0!3m2!1sid!2sid!4v1691909759565!5m2!1sid!2sid"
        width="250" height="250" style="border:0;" allowfullscreen="" loading="lazy"
        referrerpolicy="no-referrer-when-downgrade"></iframe>
        <iframe width="560" height="315" src="https://www.youtube.com/embed/ya3Z8H9WUR0" title="YouTube video player"
            frameborder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
            allowfullscreen></iframe>
</body>
</html>
